import { buildWebSite } from "https://dsd-development.github.io/api-d/functions/buildSiteWeb.js";

export function WBcheckUser(siteName, siteId) {
    const WBcheckUserComponent = {
        Style: `
            body {
                background-color: #383838;
            }
            
            .chapta {
                width: 80%; 
                max-width: 300px; 
                height: 75px; 
                background-color: rgb(80, 80, 80);
                border-radius: 10px;
                padding: 10px;
                box-sizing: border-box; 
                position: absolute;
                top: 50%; 
                left: 50%;
                transform: translate(-50%, -50%);
            }
            
            @media screen and (max-width: 600px) {
                .chapta {
                    width: 90%;
                    max-width: none; 
                }
            }
            
            .bottom-fixed {
                position: fixed;
                bottom: 0;
                left: 0;
                width: 100%;
                padding: 10px;
                z-index: 9999; 
            }
        `,
        Html: `
            <img class="d-flex m-auto" style="position: relative; top: 65px; max-width: 380px;" src="data:image/png;base64," alt="">

            <div class="chapta">
                <div class="text-center mt-2">
                    <input class="form-check-input" type="checkbox" value="" style="width: 30px; height: 30px; cursor: pointer;" id="flexCheckDefault">
                    <label class="form-check-label text-white fw-bold mt-2" style="margin-left: 10px;" for="flexCheckDefault">Non sono un Robot</label>
                    <br>
                    <br>
                    <br>
                    <p class="text-white text-center fw-bold">ApiD Protection | Danilo Giannotta</p>
                </div>
            </div>

            <div class="bottom-fixed" id="loadingHT" style="display: none;">
                <div class="d-flex align-items-center" style="padding: 10px;">
                    <strong role="status" class="text-white">Caricamento Sito Web...</strong>
                    <div class="spinner-border ms-auto text-light" aria-hidden="true"></div>
                </div>
            </div>
        `
    }
    var styleElement = document.createElement('style');
    styleElement.textContent = WBcheckUserComponent.Style;
    document.head.appendChild(styleElement);
    document.body.innerHTML = WBcheckUserComponent.Html;
    document.title = "ApiD Protection | Danilo Giannotta";
    const checkbox = document.getElementById('flexCheckDefault');
    const loadingDiv = document.getElementById('loadingHT');
    var mouseIsMoved = false;
    checkbox.addEventListener('change', function() {
        if (this.checked && mouseIsMoved) {
            checkbox.disabled = true;
            loadingDiv.style.display = 'block';
            const time = setTimeout(() => {
                buildWebSite(siteName, siteId);
                clearTimeout(time);
            }, 3000)
        } else {
            location.reload();
        }
    });
    document.addEventListener('mousemove', function() {mouseIsMoved = true});
}
